Insert into TBL_CBT (CB_NUM,CB_PCODE,CB_PROB,CB_FIR,CB_SEC,CB_THI,CB_FOU,CB_ANS) values (6,'P0006','학적 테이블에서 전화번호가 Null값이 아닌 학생명을 모두 검색할 때, SQL 구분으로 옳은 것은?','SELECT 학생명 FROM 학적 WHERE 전화번호 DON''T NULL;','SELECT 학생명 FROM 학적 WHERE 전화번호 != NULL;','SELECT 학생명 FROM 학적 WHERE 전화번호 IS NOT NULL;','SELECT 학생명 FROM 학적 WHERE 전화번호 IS 0;','SELECT 학생명 FROM 학적 WHERE 전화번호 IS NOT NULL;');
